import React from "react";
import "./App.css";
import { movies } from "./data";

export const Shows = () => {
  return (
      <div className="show-container"> Welcome to Catherine's Netflix
      {movies.map((data,key) => {
          return (
              <div key={key}> 
              {data.title + 
                "," + 
                data.score}
                </div>
          );
          }
        )}
      </div>
  );
};
